import React from 'react';
import { Link } from "react-router-dom";
import './Nav.css';
import * as Env from "./../../environments.js";

const Nav = () => {
  return (
    <div className="nav">
      <nav>
        <ul className="tab-row">
            <li>
                <Link to={Env.NAT_URL} className="tab" id="tab1">me</Link>
            </li>
            <li>
                <Link to={Env.PROJECTS_URL} className="tab" id="tab2">projects</Link>
            </li>
            <li>
                <Link to={Env.MUSIC_URL} className="tab" id="tab3">music</Link>
            </li>
            <li>
                <Link to={Env.ART_URL} className="tab" id="tab4">art</Link>
            </li>
        </ul>
      </nav>
    </div>

  )
}

export default Nav;
